import './Search.css';

const Search =(props)=>{
      return(
          <div className="search-container">
                <input onChange={()=>{props.onInputChange}} 
                placeholder="TYPE KEYWORD" 
                type="text"
                className="search-input"/>
          </div>
      )
}


export default Search;
